import { initializeApp } from 'firebase/app';
import { getFirestore } from 'firebase/firestore';
import { getAuth } from 'firebase/auth';

// Firebase config - using the provided credentials
const firebaseConfig = {
  apiKey: process.env.REACT_APP_FIREBASE_API_KEY || "AIzaSyBBI6y4l7LvhIon6R03HO1Z5hfFAE00Gf4",
  authDomain: process.env.REACT_APP_FIREBASE_AUTH_DOMAIN || "humanetracker.firebaseapp.com",
  projectId: process.env.REACT_APP_FIREBASE_PROJECT_ID || "humanetracker",
  storageBucket: process.env.REACT_APP_FIREBASE_STORAGE_BUCKET || "humanetracker.appspot.com",
  messagingSenderId: process.env.REACT_APP_FIREBASE_MESSAGING_SENDER_ID || "290888219067",
  appId: process.env.REACT_APP_FIREBASE_APP_ID || "1:290888219067:web:defaultappid"
};

const app = initializeApp(firebaseConfig);
export const db = getFirestore(app);
export const auth = getAuth(app);
